import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class MACHOMODService {

  constructor() 
  {
    let audio = new Audio();
    audio.src = "data:audio/mpeg;base64,";
    audio.volume = 1;
    console.log("MACHO'D");
    document.addEventListener('keydown', () => {
      audio.play();
    });
   }
}
